import{_ as t,c as p,o,a4 as a}from"./chunks/framework.qL1yNBZ5.js";const h=JSON.parse('{"title":"Windows安装RabbitMQ","description":"","frontmatter":{},"headers":[],"relativePath":"code/rabbitmq/Windows安装RabbitMQ.md","filePath":"code/rabbitmq/Windows安装RabbitMQ.md"}'),n={name:"code/rabbitmq/Windows安装RabbitMQ.md"},e=a('<h1 id="windows安装rabbitmq" tabindex="-1"><a href="https://www.cnblogs.com/java-spring/p/13645715.html" target="_blank" rel="noreferrer">Windows安装RabbitMQ</a> <a class="header-anchor" href="#windows安装rabbitmq" aria-label="Permalink to &quot;[Windows安装RabbitMQ](https://www.cnblogs.com/java-spring/p/13645715.html)&quot;">​</a></h1><p>文末有：<a href="https://www.cnblogs.com/java-spring/p/13645778.html" target="_blank" rel="noreferrer">SpringBoot整合RabbitMQ</a></p><p>rabbitMQ是Erlang语言开发的所以先下载Erlang</p><p><a href="https://www.erlang.org/downloads" target="_blank" rel="noreferrer">https://www.erlang.org/downloads</a></p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb3460a0256.png" alt=""></p><p>下载到磁盘中</p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb3460c7afd.png" alt=""></p><p>双击安装</p><p>配置环境变量</p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb34610797e.png" alt=""></p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb34612ec5b.png" alt=""></p><p>检验</p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb3461632d6.png" alt=""></p><p>下载RabbitMQ</p><p><a href="https://www.rabbitmq.com/download.html" target="_blank" rel="noreferrer">https://www.rabbitmq.com/download.html</a></p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb346186fd8.png" alt=""></p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb3461b336e.png" alt=""></p><p>双击安装</p><p>安装完成后，开始安装RabbitMQ-Plugins插件</p><p>先cd D:\\software\\RabbitMQ\\rabbitmq_server-3.8.8\\sbin</p><p>然后运行命令：rabbitmq-plugins enable rabbitmq_management</p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb3461d150c.png" alt=""></p><p>执行rabbitmqctl status，出现以下内容，说明成功</p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb34620f794.png" alt=""></p><p>然后双击运行rabbitmq-server.bat</p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb346234801.png" alt=""></p><p>等几秒钟，在浏览器访问 <code>http://localhost:15672/</code></p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb34625c903.png" alt=""></p><p>输入默认账号：guest，密码：guest，登陆成功</p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb346278a23.png" alt=""></p><p>然后将RabbitMQ做成Windows服务</p><p>以管理员身份运行cmd</p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb3462aeff0.png" alt=""></p><p>cd D:\\software\\RabbitMQ\\rabbitmq_server-3.8.8\\sbin</p><p>执行rabbitmq-service.bat install</p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb3462d7aa9.png" alt=""></p><p>可以通过任务管理器去查看RabbitMQ服务</p><p><img src="http://home.wxioi.cn:8086/wp-content/uploads/2024/02/post-51-65bb3463183c3.png" alt=""></p><p>代码请参照：</p><p><a href="https://www.cnblogs.com/java-spring/p/13645778.html" target="_blank" rel="noreferrer">SpringBoot整合RabbitMQ</a></p>',40),i=[e];function s(r,b,c,l,w,m){return o(),p("div",null,i)}const g=t(n,[["render",s]]);export{h as __pageData,g as default};
